import React from "react";
import Footer from "./Footer";
import Navbar from "./Navbar";

const Realisations = ({ titre, description, imageSrc }) => {
    return (
        <section id="#Realisations">
            <Navbar />
            <h3>Découvrez mes projets réalisés, qui mettent en avant mon expertise en matière de développement web.</h3>
            <div className="projet">
      <h4>{titre}</h4>
      <img src={imageSrc} alt={titre} />
      <p>{description}</p>
    </div>
            <Footer />
        </section>
    )
}

export default Realisations;
